import React  from "react"
import "./table.css"

// eslint-disable-next-line 
const link = (linkName) => <a 
        href={linkName}
        target="_blank"
        > 
        [link]
    </a>


const Table = (props) => {
    const title  = props.tableName;
    const data   = props.details[title];
    return (
    <>
        <table>
            <tr>
                <th> # </th>
                {
                    [
                        "Company", 
                        "Designation", 
                        "StartDate", 
                        "EndDate"
                    ].map(values => <th> {values}</th>)
                }
            </tr>
            {
                data.map((row, pos) => 
                    <tr>
                        <td>  {pos}              </td>
                        <td>  {row.Company}      </td>
                        <td>  {row.Designation } </td>
                        <td>  {row.StartDate}    </td>
                        <td>  {row.EndDate}      </td>
                        <td>   {link(row.Link)} </td>
                    </tr>
                )
            }
        </table>
    </>
    )

} 

export default Table;
